import React, { useEffect } from 'react';
import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { Container, Box } from '@mui/material';

// Import components
import Login from './pages/Login';
import SimpleDashboard from './pages/SimpleDashboard';
import AdminDashboard from './pages/AdminDashboard';
import ProjectCreate from './pages/ProjectCreate';
import Marketplace from './pages/Marketplace';
import CarbonCredits from './pages/CarbonCredits';
import PaymentDistribution from './pages/PaymentDistribution';
import Reports from './pages/Reports';

// Import blockchain context
import { BlockchainProvider } from './contexts/BlockchainContext';

// Layout wrapper for authenticated routes (simplified without Navbar for now)
const AuthenticatedLayout = ({ children }) => (
  <Container maxWidth="xl" sx={{ mt: 2, mb: 4 }}>
    {children}
  </Container>
);

// Simple protected route component
const ProtectedRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('userInfo') !== null;
  return isAuthenticated ? children : <Navigate to="/login" replace />;
};

function App() {
  const location = useLocation();

  // Ensure users start at login page when app loads
  useEffect(() => {
    // If user visits root and is not authenticated, clear any stale data
    if (location.pathname === '/' && !localStorage.getItem('userInfo')) {
      localStorage.removeItem('auth_token');
      localStorage.removeItem('userInfo');
    }
  }, [location.pathname]);

  return (
    <BlockchainProvider>
      <Box className="App">
        <Routes>
          {/* Public routes */}
          <Route path="/login" element={<Login />} />

          {/* Protected routes with layout */}
          <Route path="/" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <SimpleDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/dashboard" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <SimpleDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/user/dashboard" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <SimpleDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/projects/create" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProjectCreate />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/projects" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <SimpleDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/data-collection" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <SimpleDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/verification" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <SimpleDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/marketplace" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <Marketplace />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/carbon-credits" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <CarbonCredits />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/payments" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <PaymentDistribution />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/reports" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <Reports />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          {/* Admin routes */}
          <Route path="/admin/dashboard" element={
            <ProtectedRoute>
              <AdminDashboard />
            </ProtectedRoute>
          } />

          {/* Fallback route */}
          <Route path="*" element={<Navigate to="/login" replace />} />
        </Routes>
      </Box>
    </BlockchainProvider>
  );
}

export default App;
